    false,nt"url": null,nt"notes": "Ruby Lake NWR 1988 Annual Water Management
    Report 1989 Annual Water Management Plan. Includes 1988 weather summary, water availability
    forecast, summary of 1988 water levels, effects of 1988 water levels on the ecology
    of each management unit, and objectives. Due to a one to two year water cycle, the
    refuge is not anticipating an excess of water during 1989. In 1989, we will be seeing
    the effects of winter 1987-88 which had normal to below normal snow pack. This followed
    already dry conditions suggesting that all water supplies needed to be replenished.
    As the Water Management Plan states, periods of most severe water shortages involved
    two or more successive years of below normal precipitation. The refuge will not
    see the effect of the above normal snow pack of 1988-89 until 1990. Like other areas,
    Ruby Lake experienced a water shortage during 1988. Water levels dropped rapidly
    during the hot, dry summer and not all marsh units could be maintained at objective
    levels. According to the 1988 revised Water Management Plan, high priority in year's
    with water shortage are given to the five small diked units followed by the South
    Sump, East Sump and the North Sump. In 1988, there was not enough water to maintain
    the East Sump and the North Sump. By August, surface water was absent in both units
    except within portions of the borrow ditches. The South Sump was maintained at objective
    levels until mid-June. Evaporation became greater than the available inflow of water
    and thus, the water continued to drop until mid-October. No increases in levels
    occurred during the remainder of the year. The water level was close to a foot below
    the objective level in the South Sump by the end of the year. The small diked units
    throughout the year were able to be maintained close to objective levels with the
    exception of Unit 20 where a planned drawdown was accomplished.",nt"license_title":
